import React, {useState, useEffect}from "react";
import InfiniteScroll from 'react-infinite-scroll-component';
import { Avatar, Divider, List, Skeleton, Card } from 'antd';
const data = [
  {
    title: "ChatMind",
    openSource: "n",
    href: "https://chatmind.tech/cn?ref=ai-bot.cn",
    input: "Áî®Êà∑ÈúÄÊ±Ç",
    output: "ÊÄùÁª¥ÂØºÂõæ",
    brief: `
1.Â§öÊ®°ÊÄÅÊîØÊåÅÔºö ChatmindÊîØÊåÅÂ§öÁßçËæìÂÖ•ÊñπÂºèÔºåÂåÖÊã¨ÊñáÊú¨„ÄÅËØ≠Èü≥„ÄÅÂõæÂÉèÁ≠âÔºå‰ΩøÁî®Êà∑ËÉΩÂ§üÊõ¥ÁÅµÊ¥ªÂú∞ËøõË°å‰∫§‰∫íÂíåÊÄùÁª¥ÂØºÂõæÂàõ‰Ωú„ÄÇ
2.Âº∫Â§ßÁöÑ‰∏ä‰∏ãÊñáÁêÜËß£‰∏éÁîüÊàêÔºö Áî±GPT-4È©±Âä®ÁöÑChatmindÂÖ∑Â§áÂº∫Â§ßÁöÑ‰∏ä‰∏ãÊñáÁêÜËß£ÂíåÁîüÊàêËÉΩÂäõÔºåËÉΩÂ§üÊõ¥Â•ΩÂú∞ÁêÜËß£Áî®Êà∑ËæìÂÖ•Âπ∂ÁîüÊàêÊõ¥ÊúâÈÄªËæëÂíåËøûË¥ØÊÄßÁöÑÂõûÂ∫îÔºåÊúâÂä©‰∫éÂàõÂª∫Êõ¥Êô∫ËÉΩÂåñÁöÑÊÄùÁª¥ÂØºÂõæ„ÄÇ
3.ÂÆûÊó∂Êï∞ÊçÆËé∑ÂèñÔºö ChatmindËÉΩÂ§üÂáÜÁ°ÆËé∑ÂèñÂÆûÊó∂Êï∞ÊçÆÔºå‰∏∫Áî®Êà∑Êèê‰æõÂèäÊó∂„ÄÅÊúÄÊñ∞ÁöÑ‰ø°ÊÅØÔºåÊúâÂä©‰∫é‰øùÊåÅÊÄùÁª¥ÂØºÂõæÁöÑÊó∂ÊïàÊÄß
    `,
  },
];

const Tools = () => {

    const [loading, setLoading] = useState(false);
  const [data, setData] = useState([]);
  const loadMoreData = () => {
    if (loading) {
      return;
    }
    setLoading(true);
    fetch('https://randomuser.me/api/?results=10&inc=name,gender,email,nat,picture&noinfo')
      .then((res) => res.json())
      .then((body) => {
        setData([...data, ...body.results]);
        setLoading(false);
      })
      .catch(() => {
        setLoading(false);
      });
  };
  useEffect(() => {
    loadMoreData();
  }, []);
  return (
    <div>
      <Card
        style={{
          "border-radius": "0px",
          "font-size": "20px",
          "text-align": "center",
        }}
      >
        <p>DesAIgn Tools List</p>
      </Card>
      <div
      id="scrollableDiv"
      style={{
        height: 400,
        overflow: 'auto',
        padding: '0 16px',
        border: '1px solid rgba(140, 140, 140, 0.35)',
      }}
    >
      <InfiniteScroll
        dataLength={data.length}
        next={loadMoreData}
        hasMore={data.length < 50}
        loader={
          <Skeleton
            avatar
            paragraph={{
              rows: 1,
            }}
            active
          />
        }
        endMessage={<Divider plain>It is all, nothing more ü§ê</Divider>}
        scrollableTarget="scrollableDiv"
      >
        <List
          dataSource={data}
          renderItem={(item) => (
            <List.Item key={item.email}>
              <List.Item.Meta
                avatar={<Avatar src={item.picture.large} />}
                title={<a href="https://ant.design">{item.name.last}</a>}
                description={item.email}
              />
              <div>Content</div>
            </List.Item>
          )}
        />
      </InfiniteScroll>
    </div>
    </div>
  );
};
export default Tools;
